import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product detail modal to be present
    await page.waitForSelector('.product-detail', { timeout: 5000 });

    // Click on the "Shop now" button to open the product detail modal
    await page.click('button.cta-button');

    // Wait for the modal to appear
    await page.waitForSelector('.modal-content', { timeout: 5000 });

    // Take a screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Extract product title from the modal
    const productTitle = await page.textContent('.product-detail-title');

    return {
      success: true,
      action: "Opened product detail modal and extracted product title",
      extractedData: { productTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
